const initialState = {
    name: null,
    title: null,
    li: [],
}
const reducer = (state = initialState, action) => {
    console.log(state, action);
    switch (action.type) {
        case "name": return { ...state, name: action.name };
        case "title": return { ...state, title: action.title };
        case "submit": () => {
            const data = state.li;

        };
        default: return state;
    }
}
export default reducer;
